input = ''
# input = 'mjqjpqmgbljsphdztnvjfqwrcgsmlb'
# input = 'zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw'

def process(str, length):
    for i in range(length, len(str)):
        s = str[i - length:i]
        if len(set(s)) == length:
            return i
    return -1


print(process(input, 4))
print(process(input, 14))
